"use strict";exports.id=232,exports.ids=[232],exports.modules={7232:e=>{e.exports=JSON.parse('[{"id":1,"title":"FireKubeX","shortDescription":"Simplifies Kubernetes, easing app deployment for developers.","Summary":"This script simplifies the deployment process for developers by abstracting the complexities of Kubernetes. By providing the necessary configuration in the config.yaml file, developers can quickly deploy their applications to a Kubernetes cluster with ease without the need for in-depth Kubernetes knowledge. It also supports starting and stopping services, along with options for development (dev) and production (prod) modes. The config.yaml is intended for individual microservices. It aims to enhance the efficiency of deploying and scaling microservices by providing a flexible and customizable solution.","project_type":"Developer Tools and Utilities","contributors":["jagannathmfs","amitshr6779"],"project_goal":"The script is designed to handle multiple services, making it scalable for diverse microservices architectures. Additionally, it can be extended easily to incorporate additional features or adapt to evolving Kubernetes best practices.","target_users":"Targeted users will be the developers who needs to deploy their applications in a kubernetes cluster on their own local system or in any cloud kubernetes like (EKS,AKS,GKE).","risk":"Potential risks related to conflicting with proprietary IP or current customer work if any: None"},{"id":2,"title":"SSR Guide","shortDescription":"The ultimate guide for SSR implementation"},{"id":3,"title":"IframeVsWebComponent","shortDescription":"Benchmarking performance with iframes and web components"},{"id":4,"title":"FMDAPI Python Weaver","shortDescription":"Seamless frontend integration with Filemaker Database"},{"id":5,"title":"Angular Canvas Editor","shortDescription":"Multipage document editing in Angular with Canvas"},{"id":6,"title":"EHRConnect","shortDescription":"Seamlessly connect with any EHR"}]')}};